import React, { Component } from "react";
import "./Works.css";
import Header from "../components/Header";
import styled from "styled-components";

//Import Components
import CategoryDiv from "../components/CategoryDiv";
import ItemCell from "../components/ItemCell";

//Import thumbnail images
import thumb_coc from "../img/thumb_coc.jpg";
import thumb_yng from "../img/thumb_esrc_pink.jpg";
import thumb_gutsy from "../img/thumb_Gutsy.jpg";
import thumb_doh from "../img/thumb_ProjectionMapping.jpg";
import thumb_jini from "../img/thumb_MovWork.jpg";
import thumb_toyp from "../img/thumb_ProjectionMapping2.jpg";

const MainContainer = styled.div`
  height: auto;
  padding-top: 10em;
  padding-left: 17%;
  padding-right: 17%;
  background-color: white;

  @media screen and (max-width: 1080px) {
    padding-left: 10%;
    padding-right: 10%;
  }
`;

const CategoryContainer = styled.div`
  float: left;
  width: 100%;
  margin-bottom: 5vh;
`;

class Works extends Component {
  render() {
    return (
      <>
        <Header nav="Pyeong > Works"/>
        <MainContainer>
          <div className="item-container">
            <CategoryContainer>
              <CategoryDiv desc="UI/UX" />

              <ItemCell 
                alt="COC 2016"
                thumbImg={thumb_coc}
                title="COC 2016"
                category="공간 VR"
              >
              </ItemCell>

              <ItemCell 
                alt="연애능력고사"
                thumbImg={thumb_yng}
                title="연애능력고사"
                category="UI 제작"
              >
              </ItemCell>

              <ItemCell href="#" className="item-cell">
                <div>
                  <img alt={"Gutsy"} className="item-thumb" src={thumb_gutsy} />
                </div>
                <strong>UI 제작 / UX 설계</strong> <br></br>
                <em>Gutsy</em>
              </ItemCell>
            </CategoryContainer>

            <CategoryContainer>
              <CategoryDiv desc="Graphics" />
              <ItemCell href="#" className="item-cell">
                <div>
                  <img
                    alt={"Dancing on the hills"}
                    className="item-thumb"
                    src={thumb_doh}
                  />
                </div>
                <strong>프로젝션 매핑</strong> <br></br>
                <em>Dancing on the hills</em>
              </ItemCell>

              <ItemCell href="#" className="item-cell">
                <div>
                  <img
                    alt={"Empi Jini"}
                    className="item-thumb"
                    src={thumb_jini}
                  />
                </div>
                <strong>모션그래픽</strong> <br></br>
                <em>Empy jini</em>
              </ItemCell>
            </CategoryContainer>

            <CategoryContainer>
              <CategoryDiv desc="Web" />
              <ItemCell href="#" className="item-cell">
                <div>
                  <img
                    alt={"Toy Projects"}
                    className="item-thumb"
                    src={thumb_toyp}
                  />
                </div>
                <strong>?</strong> <br></br>
                <em>toy project</em>
              </ItemCell>
            </CategoryContainer>
          </div>
        </MainContainer>
      </>
    );
  }
}

export default Works;
